import { Link } from 'react-router-dom';
import './../styles/Buttons.css'

function FwdButton(props) {
    return(
        <Link to={props.destination} className='forward-button' >Continue</Link>
    )
}

function BckButton(props) {
    return(
        <Link to={props.destination} className='back-button' >Previous</Link>
    );
}

export default FwdButton;
